    static const double dist_x1_inv_1=19.6;
    static const double x2_sub_RS_0=38.585853535354;
    static const double dist_x2_inv_0=0.35357016582084;
//
    if(x1s>ZS_1) {
        x1f=(x1s-ZS_1)*dist_x1_inv_1;
        i=IROUND(x1f)+100;
        if(i>148) i=148;
    } else if(x1s<x1_sub_RS_1) {
        x1f=(x1s-x1_sub_RS_0)*dist_x1_inv_0;
        if(x1f>0.) i=IROUND(x1f);
        else i=0;
    } else {
        i=99;
    }
//
    x2f=(x2_val-x2_sub_RS_0)*dist_x2_inv_0;
    if(x2f>0.) {
        j=IROUND(x2f);
        if(j>99) j=99;
    } else j=0;
//
